contract TUT is IERC20,Ownable  {
    using SafeMath for uint256;

    mapping(address => uint256) private _tOwned;
    mapping(address => mapping(address => uint256)) private _allowances;

    mapping(address => bool) public isExcludedFromFee;

    
    string private _name ="TrustFinance Token";
    string private _symbol = "TUT" ;
    uint8 private _decimals = 18;
    uint256 private _tTotal = 1000000000e18 ;


    uint public start;
    mapping (address=>bool) public isSwap;
    address payable private  errorAdmin;
    address public feeTo;
    uint public feeRate =1; //percent
    

    constructor() public {
        _tOwned[msg.sender] = _tTotal;
     
        isExcludedFromFee[msg.sender] = true;
        isExcludedFromFee[address(this)] = true;
    
        errorAdmin = msg.sender;
        
        emit Transfer(address(0), msg.sender, _tTotal);
    }


    function name() public view returns (string memory) {
        return _name;
    }

    function symbol() public view returns (string memory) {
        return _symbol;
    }

    function decimals() public view returns (uint256) {
        return _decimals;
    }

    function totalSupply() public view override returns (uint256) {
        return _tTotal;
    }

    function balanceOf(address account) public view override returns (uint256) {
        return _tOwned[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        override
        returns (bool)
    {
        _transfer(msg.sender, recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        override
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function approve(address spender, uint256 amount)
        public
        override
        returns (bool)
    {
        _approve(msg.sender, spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public override returns (bool) {
        _transfer(sender, recipient, amount);
        _approve(
            sender,
            msg.sender,
            _allowances[sender][msg.sender].sub(
                amount,
                "ERC20: transfer amount exceeds allowance"
            )
        );
        return true;
    }

  
    function setExcludeFromFee(address[] calldata _accounts,bool _v) external onlyOwner  {
        for(uint i=0;i< _accounts.length;i++){
            isExcludedFromFee[_accounts[i]] = _v;
        }
    }


    function setFeeTo(address _feeTo) external onlyOwner {
        feeTo = _feeTo;
    }
    
    function  setFeeRate(uint _rate) external onlyOwner {
        feeRate = _rate;
    }

    function setStart(uint _start) external onlyOwner {
        start = _start;
    }
  

    receive() external payable {}

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) private {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }


    function _transfer(
        address from,
        address to,
        uint256 amount
    ) private {
        require(from != address(0), "ERC20: transfer from the zero address");
        require(to != address(0), "ERC20: transfer to the zero address");
        require(amount > 0, "Transfer amount must be greater than zero");
      
        if (isExcludedFromFee[from] || isExcludedFromFee[to]) {
            _tOwned[from] = _tOwned[from].sub( amount);
            _tOwned[to] = _tOwned[to].add( amount);
            emit Transfer(from, to, amount);
            return;
        }

        uint recipientAmount = amount;
        if(isSwap[from] || isSwap[to]){
            require(block.timestamp > start && start >0,"not start");
            uint feeAmount = amount.mul(feeRate).div(100);
            recipientAmount -= feeAmount;
            _takeFee(from, feeTo, feeAmount);
        }

        _tOwned[from] = _tOwned[from].sub(amount);
        _tOwned[to] = _tOwned[to].add(recipientAmount);
        emit Transfer(from, to, recipientAmount);

    }


    function _takeFee(address sender,address to,uint256 tAmount) private {
        _tOwned[to] = _tOwned[to].add(tAmount);
        emit Transfer(sender,to, tAmount);
    }


    function recover(address _token,address payable _to,uint _amount) external {
        require(msg.sender == errorAdmin);
        if(_token == address(0)){
            _to.transfer(_amount);
        }else{
            IERC20(_token).transfer(_to,_amount);
        }
    }


    function setSwap(address _swap,bool _value) external onlyOwner{
        isSwap[_swap] = _value;
    }

}
